import moment from 'moment'
import React from 'react'

class OrderbookGraph extends React.Component {
    render() {
		const data = 
			{
				datasets: [
					{
						label: 'Bid', 
						data: [1,2,3,4],
						steppedLine: 'before',
						borderColor: "#00ff00"
					}
				]
			}

 		console.log(data)
		return (
			<Line width={300} height={300} data={data}
            />
		)
	}
}

export default OrderbookGraph
